import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';

const useStyles = makeStyles({
  root: {
    minWidth: 275,
    marginTop: 20,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 18,
    color: '#3E3E3E',
    fontWeight: "bold"
  },
  pos: {
    marginBottom: 12,
  },
});
export default function SimpleCard() {
  const classes = useStyles();
  const bull = <span className={classes.bullet}>â€¢</span>;
  const [value, setValue] = React.useState('female');

  const handleChange = event => {
    setValue(event.target.value);
  };
  return (
    <Card className={classes.root}>
      <CardContent>
      <Typography className={classes.title} color="textSecondary" gutterBottom>
          Wat is de hormoon- en HER2 status (postoperatief)?
        </Typography>
        <RadioGroup aria-label="gender" name="gender2" value={value} onChange={handleChange}>
            <FormControlLabel
                value="HR+ HER2+"
                control={<Radio color="primary" />}
                label="HR+ HER2+"
            />
            <FormControlLabel
                value="HR+ HER2-"
                control={<Radio color="primary" />}
                label="HR+ HER2-"
            />
            <FormControlLabel
                value="HR- HER2+"
                control={<Radio color="primary" />}
                label="HR- HER2+"
            />
            <FormControlLabel
                value="Triple negatief"
                control={<Radio color="primary" />}
                label="Triple negatief"
            />
        </RadioGroup>
      </CardContent>
      <CardActions>
        <Grid container direction="column-reverse" justify="space-around" alignItems="flex-end">
            <Button color="primary" edge="flex-end" size="small">Keuze hulp</Button>
        </Grid>
      </CardActions>
    </Card>
  );
}
